$templateCache.put("plugins/api-manager/html/dash.html","<!DOCTYPE html>\n<html lang=\"en\">\n<head>\n    <meta charset=\"utf-8\">\n    <meta name=\"viewport\" content=\"width=device-width, initial-scale=1.0\"></meta>\n</head>\n\n<body>\n<div>\n\n    <div ng-include=\"headerInclude\"></div>\n    <div ng-controller=\"Apiman.DashController\" class=\"page container\" data-field=\"page\" ng-cloak=\"\" ng-show=\"pageState == \'loaded\'\">\n        <div class=\"row\">\n            <div class=\"col-md-12\">\n                <h1 apiman-i18n-key=\"dash.page-heading\">API Management</h1>\n                <hr />\n            </div>\n            <div class=\"col-md-12 no-phone\">\n          <span class=\"description\" apiman-i18n-key=\"dash.page-description\">\n            Welcome to apiman, open source API management.  Use this software to provide\n            various APIs (APIs) to your consumers (Client Apps) through a secure, scalable,\n            and governed Gateway layer.  API Management allows API Developers to centralize\n            control and analysis of their APIs.  It also provides a central location for\n            Client App Developers to find and consume available APIs.\n          </span>\n                <hr />\n            </div>\n        </div>\n        <div class=\"row\">\n            <div class=\"col-md-12\">\n\n                <div class=\"dash-group\">\n                    <div class=\"title\">\n                        <i class=\"fa fa-shield\"></i>\n                        <span apiman-i18n-key=\"organizations\">Organizations</span>\n                    </div>\n                    <div class=\"description\" apiman-i18n-key=\"dash.orgs-description\">\n                        All APIs and Client Apps must be managed within the context of an\n                        Organization.  You can be a member of multiple Organizations at the same\n                        time, with different roles in each:  you can be a Client App\n                        Developer in one organization and an API Developer in another.\n                    </div>\n                    <div class=\"actions\">\n                        <ul>\n                            <li><a id=\"org-new\" href=\"{{ pluginName }}/new-org\" apiman-i18n-key=\"actions.create-new-org\" data-field=\"createOrg\">Create a New Organization</a></li>\n                            <li><a id=\"org-browse\" href=\"{{ pluginName }}/browse/orgs\" apiman-i18n-key=\"actions.browse-orgs\" data-field=\"browseOrgs\">Browse/Find an Organization</a></li>\n                            <li><a id=\"org-my-orgs\" href=\"{{ pluginName }}/users/{{ currentUser.username }}/orgs\" apiman-i18n-key=\"actions.my-orgs\" data-field=\"myOrgs\">Go to My Organizations</a></li>\n                        </ul>\n                    </div>\n                </div>\n\n                <div class=\"dash-group pull-right\">\n                    <div class=\"title\">\n                        <i class=\"fa fa-puzzle-piece\"></i>\n                        <span apiman-i18n-key=\"apis\">APIs</span>\n                    </div>\n                    <div class=\"description\" apiman-i18n-key=\"dash.apis-description\">\n                        Create, find, or manage APIs.  A API is also known as an API - anything\n                        that can be invoked remotely by some sort of client application.  This platform\n                        simply provides a way to expose existing APIs by defining them as APIs and\n                        attaching value-added policies to them.\n                    </div>\n                    <div class=\"actions\">\n                        <ul>\n                            <li><a id=\"apis-consume\" href=\"{{ pluginName }}/browse/apis\" apiman-i18n-key=\"actions.find-api\">Find/Consume an API</a></li>\n                            <li><a id=\"apis-manage\" href=\"{{ pluginName }}/users/{{ currentUser.username }}/apis\" apiman-i18n-key=\"actions.my-apis\">Manage My APIs</a></li>\n                            <li><a id=\"api-new\" href=\"{{ pluginName }}/new-api\" apiman-i18n-key=\"actions.create-api\">Create a New API</a></li>\n                        </ul>\n                    </div>\n                </div>\n\n                <div class=\"dash-group\">\n                    <div class=\"title\">\n                        <i class=\"fa fa-gears\"></i>\n                        <span apiman-i18n-key=\"clients\">Client Apps</span>\n                    </div>\n                    <div class=\"description\" apiman-i18n-key=\"dash.clients-description\">\n                        Create and manage your Client Apps.  A Client App is the thing that consumes\n                        APIs (APIs).  These consumers must be defined in this platform so that\n                        contracts can be created between them and the APIs they wish to consume.\n                    </div>\n                    <div class=\"actions\">\n                        <ul>\n                            <li><a id=\"clients-manage\" href=\"{{ pluginName }}/users/{{ currentUser.username }}/clients\" apiman-i18n-key=\"actions.my-clients\" data-field=\"myClients\">Manage My Client Apps</a></li>\n                            <li><a id=\"clients-new\" href=\"{{ pluginName }}/new-client\" apiman-i18n-key=\"actions.new-client\" data-field=\"createClient\">Create a New Client App</a></li>\n                        </ul>\n                    </div>\n                </div>\n\n                <div class=\"dash-group dash-admin-group pull-right\" data-field=\"adminDashPanel\" ng-show=\"isAdmin\">\n                    <div class=\"title\">\n                        <i class=\"fa fa-gavel\"></i>\n                        <span apiman-i18n-key=\"system-administration\">System Administration</span>\n                    </div>\n                    <div class=\"description\" apiman-i18n-key=\"dash.system-description\">\n                        Hey it looks like you\'re an administrator!  Here are some things only you can do.\n                        These are system-wide settings you\'re thinking about modifying, so please proceed\n                        with caution.\n                    </div>\n                    <div class=\"actions\">\n                        <ul>\n                            <li><a id=\"admin-roles\" href=\"{{ pluginName }}/admin/roles\" apiman-i18n-key=\"actions.manage-roles\" data-field=\"manageRoles\">Manage Roles/Permissions</a></li>\n                            <li><a id=\"admin-policyDefs\" href=\"{{ pluginName }}/admin/policyDefs\" apiman-i18n-key=\"actions.manage-policyDefs\" data-field=\"managePolicyDefs\">Manage Policy Definitions</a></li>\n                            <li><a id=\"admin-gateways\" href=\"{{ pluginName }}/admin/gateways\" apiman-i18n-key=\"actions.manage-gateways\" data-field=\"manageGateways\">Manage Gateways</a></li>\n                            <li><a id=\"admin-plugins\" href=\"{{ pluginName }}/admin/plugins\" apiman-i18n-key=\"actions.manage-plugins\" data-field=\"managePlugins\">Manage Plugins</a></li>\n                            <li><a id=\"admin-export\" href=\"{{ pluginName }}/admin/export\" apiman-i18n-key=\"export-import-data\">Export/Import Data</a></li>\n                        </ul>\n                    </div>\n                </div>\n            </div>\n        </div>\n    </div> <!-- /container -->\n</div>\n</body>\n</html>");
